import React from "react";
import { View, StyleSheet, Text } from "react-native";

function messegeCard({ mes }) {
  return (
    <View style={styles.container}>
      <Text> {mes} </Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    padding: 30,
    backgroundColor: "red",
  },
});

export default messegeCard;
